onChange.script:
if currentValue.value == True:
	currentDate = system.date.now()
	GetCurrentSeason = system.db.runNamedQuery("WinterShelterGlobal/getCurrentSeason")
	DateFilter = self.getChild("root").getChild("Labels").getChild("DateFilter").props.params.selection
	minDate = self.custom.minDate
	maxDate = self.custom.maxDate
	system.perspective.print('mindate: '+str(minDate))
	system.perspective.print('maxDate: '+str(maxDate))
	if DateFilter != None and DateFilter != '':
		totalDates = 1
		i = 0
		## For Last Monday to Friday
		if DateFilter in (1,2,3,4,5,6,7):
			if self.params.seasonId == GetCurrentSeason.getValueAt(0,0):
				endDate = currentDate
			else:
				endDate = system.date.getDate(int((self.custom.seasonName).split('-')[1]), 2, 31)

			while totalDates < 16 and system.date.isBetween(system.date.addDays(endDate, -i), minDate, maxDate):
				date = system.date.addDays(endDate, -i)
				if str(system.date.format(date,'u')) == str(DateFilter):
					self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[15-totalDates].Date = date
					totalDates = totalDates + 1
				i = i + 1
			if totalDates < 16:
				for j in range(totalDates,16):
					self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[15-j].Date = None

		## For Next Monday to Friday
		elif DateFilter in (8,9,10,11,12,13,14):
			if self.params.seasonId == GetCurrentSeason.getValueAt(0,0):
				startdate = currentDate
				while totalDates < 16 and system.date.isBetween(system.date.addDays(startdate, +i), minDate, maxDate):
					date = system.date.addDays(startdate, +i)
					if str(system.date.format(date,'u')) == str(DateFilter-7):
						self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[totalDates-1].Date = date
						totalDates = totalDates + 1
					i = i + 1
				if totalDates < 16:
					for j in range(totalDates,16):
						self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[15-j].Date = None
			else:
				startDate = system.date.getDate(int((self.custom.seasonName).split('-')[0]), 10, 1)
				for i in range(0,15):
					date = system.date.addDays(startDate, i)
					self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[i].Date = date

	else:
		if self.params.seasonId == GetCurrentSeason.getValueAt(0,0):
			for i in range(1,16):
				day = 15-i
				date = system.date.addDays(currentDate, -day)
#				system.perspective.print(date)
				self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[i-1].Date = date
		else:
			startDate = system.date.getDate(int((self.custom.seasonName).split('-')[0]), 10, 1)
			for i in range(0,15):
				date = system.date.addDays(startDate, i)
#				system.perspective.print(date)
				self.getChild("root").getChild("DateSelection").getChild("DateSelectors").props.instances[i].Date = date
	self.custom.updateDates = False

config.script:
selectedColumn = self.props.selection.selectedColumn
locationId = event.value["locationId"]

if selectedColumn == "locationId": 
	id = "PreviewCongregation" 
	params = {"locationId":locationId}
	if self.custom.DockID != locationId:
		system.perspective.openDock(id=id,params=params)
		payload = {"locationId":locationId}
		system.perspective.sendMessage("DockUpdate", payload=payload, scope = 'page' )
	else:
		system.perspective.toggleDock(id=id,params=params)
	self.custom.DockID = locationId
